const ScheduleForm = ({classes}) =>
{
    const TravelToSchedule = () =>
    {
        window.location.href = "http://localhost:3000/schedule"
    }

    return (
        <div className={classes.form}>
            <button onClick={TravelToSchedule}>Расписание</button>
        </div>
    )
}

export default ScheduleForm;
